import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';

const Dentist = () => {
  const [dentist, setDentist] = useState(null);
  const { id } = useParams(); // Obtener el parámetro dinámico id de la URL

  useEffect(() => {
    const fetchDentist = async () => {
      try {
        // Aquí deberías realizar la llamada real a la API para obtener los datos del dentista específico
        const response = await fetch(`https://randomuser.me/api/`);
        const data = await response.json();
        setDentist(data.results[0]); // Obtener el primer usuario aleatorio de los resultados
      } catch (error) {
        console.error('Error fetching dentist data:', error);
      }
    };
    fetchDentist();
  }, [id]); // Añadir id como dependencia para que se actualice cuando cambie

  if (!dentist) {
    return <div>Cargando...</div>;
  }

  const { name, email, phone, website } = dentist;

  return (
    <>
      <div>
        <h1>Detail Dentist</h1>
        {/* Aquí deberías mostrar la información del dentista */}
        <p>Name: {name.first} {name.last}</p>
        <p>Email: {email}</p>
        <p>Phone: {phone}</p>
        <p>Website: {website}</p>
      </div>
    </>
  )
}

export default Dentist;
